import React from 'react';
import styled from 'styled-components';

const SHome = styled.div`
  width: 98%;

  margin: 1rem 0rem 0rem 1rem;
`;

const Home = () => {
  return <SHome></SHome>;
};

// Home.getInitialProps = async context => {
//   return true;
// };

export default Home;
